const EmployeeAllowanceTable = () => {
  return (
    <table>
      <thead>
        <tr>
          <th>Employee ID</th>
          <th>Allowance Name</th>
          <th>Allowance Code</th>
          <th>Category</th>
          <th>Date</th>
          <th>Start Time</th>
          <th>End Time</th>
          <th>Duration</th>
          <th>Premium</th>
          <th>Applied Date</th>
          <th>Status</th>
        </tr>
      </thead>
      <tbody>
        {/* Employee allowance data goes here */}
      </tbody>
    </table>
  );
};

export default EmployeeAllowanceTable;
